            "job_description": "Hello,\n\nGreetings for the day.\n\nPlease go through the requirement and share me some suitable resume with contact details.\n\nEmail is the best way to reach me.\n\nLead React Developer- Need a Lead Resource\n\nLocation: Remote\n\nDuration: Long Term\n\nJd\n\nAs a technical Lead, you will Maintains active relationships with Product Owner to understand business requirements, leads requirements gathering meetings and reviews designs with the product owner Leads efforts with Integration/User Interfaces Develops and owns Program Increment list of features Develops and defines application scope and objectives and supervises the preparation of technical and/or functional specifications from with programs will be written Performs technical design reviews and code reviews Responsible for delivery of application technology solutions and data information planning effort Owns the technical development environment and works on the Enterprise team Plan 'and implement projects Developing, managing, and defending schedule Monitor and report on project progress Present to stakeholder's reports on progress as well as problems and solutions Implement and manage change when necessary to meet project outputs Do proper Risk Management and Take things to closure by meeting definition of done criteria\n\nRequirements Eight or more years programing with supporting React JS /interfacing with business stakeholders experience; and expert level experience with business and technical applications; or any combination of education and experience, which would provide an equivalent background. Three or more years working as a Technical Lead role in React JS Experience in Designing, developing and deploying UI Screens using React JS. Experience with Angular, NodeJS and other Javascript frameworks, AZURE framework Familiar with Architectural design patterns and microservices Work experience in Agile (Scrum) development teams required Retail experience preferred but no mandatory\n\nThanks,\n\nLokesh Kumar\n\n469-829-4894",
