            "job_apply_is_direct": true,
            "job_apply_quality_score": 0.5602,
            "job_description": "ERP International, LLC has an opening for a Senior React Developer supporting one of our technical projects for the Defense Information Systems Agency (DISA) and be part of a talented software development team.\n\nThis role will be focused on modernizing and implementing key user applications and related components following well-known React.js workflows (such as Flex or Redux). The ideal candidate will have a commitment to collaborative problem solving, sophisticated design, and quality.\n\nThis job is for remote work.\n\nEssential Job Functions and Responsibilities:\n• Developing Software using REACT\n• Use Jira, Confluence, and Git/Bitbucket to support development tasks.\n• Work with stakeholders and product owners to develop and implement new user interfaces.\n• Support DevSecOps tasks as assigned.\n\nQualifications:\n• * Must have a BS in Computer Science or related field.\n• Minimum of 5 years of JavaScript development experience and at least 3 years of experience with React.js.\n• Prior experience with popular React.js workflows (such as Flux or Redux).\n• Strong proficiency in JavaScript, including DOM manipulation and the JavaScript object model.\n• Thorough understanding of React.js and its core principles.\n• Familiarity with more current specifications of EcmaScript.\n• Prior experience with data structure libraries (e.g., Immutable.js).\n• Experience with RESTful APIs and a relational database\n• Knowledge of modern authorization mechanisms, such as JSON Web Token.\n• Minimum of 6 years’ experience developing software\n• Must be able to obtain a DoD Secret clearance\n• Must be a US Citizen.\n\nPreferred Qualifications:\n• Ability to understand business requirements and translate them into technical requirements.\n• Familiarity with “as-is” architecture documentation.\n• Familiar with modernization efforts\n• Familiarity with GIT, Jira, Bitbucket, Jenkins\n• Experience with development in Cloud, DevOps & Agile environments\n\nJob Type: Full-time\n\nBenefits:\n• 401(k)\n• 401(k) matching\n• Dental insurance\n• Employee assistance program\n• Employee discount\n• Flexible schedule\n• Health insurance\n• Health savings account\n• Life insurance\n• Paid time off\n• Referral program\n• Retirement plan\n• Vision insurance\n\nSchedule:\n• 8 hour shift\n\nCOVID-19 considerations:\nThis job is for remote work.\n\nExperience:\n• JavaScript development: 5 years (Required)\n• React.js: 3 years (Required)\n\nWork Location: Remote",
