            "job_apply_is_direct": true,
            "job_apply_quality_score": 0.7713,
            "job_description": "We are seeking a dynamic, experienced Full Stack React Developer to join our team. The ideal candidate is a technical expert with a deep understanding of front-end and back-end coding languages, development frameworks, and third-party libraries. You will be responsible for developing and designing front-end web architecture, ensuring the responsiveness of applications, and working alongside graphic designers for web design features, among other duties.\n\nResponsibilities:\n\n1. Develop and maintain robust and scalable full-stack solutions.\n\n2. Utilize React.js and relevant libraries to design and develop user-facing features.\n\n3. Write reusable, testable, and efficient code.\n\n4. Utilize back-end technologies such as Node.js, Express.js or others based on project requirements.\n\n5. Implement robust set of services and APIs to power the web application.\n\nRequirements:\n\n1. Bachelor's degree in Computer Science, or equivalent experience.\n\n2. Strong proficiency in JavaScript, including DOM manipulation and the JavaScript object model.\n\n3. Deep understanding of React.js and its core principles.\n\n4. Experience with Node.js and Express.js or other server technologies.\n\n5. Knowledge of modern authorization mechanisms, such as JSON Web Token (JWT).\n\n6. Experience with popular React.js workflows (such as Flux or Redux).\n\n7. Familiarity with RESTful API Integration.\n\n8. Experience with database technology such as MongoDB, MySQL, PostgreSQL.\n\n9. Proficiency with Git or other version control systems.\n\n10. Strong problem-solving skills, algorithmic skills, and data structures.\n\n11. Experience in Agile methodologies.\n\nThis role requires a highly motivated, organized and experienced developer with a passion for creating efficient, scalable and accessible web applications. The ideal candidate is a self-starter who can work both independently and as a part of a team.",
