            "job_apply_is_direct": true,
            "job_apply_quality_score": 0.6815,
            "job_description": "We are seeking a talented Full Stack Developer with expertise in ReactJS, Django and Python to join our team. As a Full Stack Developer, you will be responsible for developing and maintaining web applications, from the server-side logic to the client-side user interface. You will collaborate with cross-functional teams to deliver high-quality and scalable solutions.\n\nResponsibilities:\n\nDesign and develop robust, secure, and scalable web applications using ReactJS, Django and Python.\n\nCollaborate with product managers and stakeholders to understand project requirements and translate them into technical specifications.\n\nDevelop server-side logic, including database design, API integrations, and business logic implementation.\n\nSolid experience in web development, including front-end and back-end technologies specially in ReactJS, Python & Django.\n\nExcellent knowledge of JavaScript, HTML, CSS, and related web technologies.\n\nDemonstrated experience in bug fixing, troubleshooting, and resolving software defects.\n\nFamiliarity with version control systems, such as Git, for collaborative development.\n\nStrong problem-solving skills and the ability to think critically to identify the root cause of issues.\n\nDetail-oriented with a commitment to writing clean, maintainable, and efficient code.\n\nEffective communication skills and the ability to work collaboratively in a team environment.\n\nWrite clean, maintainable, and well-documented code following coding best practices and standards.\n\nEnsure the performance, reliability, and security of web applications.\n\nConduct thorough testing and debugging of applications, identifying and resolving issues promptly.\n\nCollaborate with other team members, including designers and other developers, to deliver high-quality solutions.\n\nKeep up to date with emerging technologies and industry trends, and propose innovative ideas for improvement.\n\nProvide technical guidance and mentorship to junior developers, as needed.\n\nRequirements:\n\nBachelor's degree in Computer Science, Engineering, or a related field (or equivalent work experience).\n\nProven experience as a Full Stack Developer with expertise in Django and Python.\n\nStrong proficiency in Django framework, including Django ORM, Django templates, and authentication systems.\n\nExperience with front-end development using HTML, CSS, and JavaScript frameworks.\n\nSolid understanding of web application architecture and RESTful APIs.\n\nProficiency in database design and SQL.\n\nFamiliarity with version control systems (e.g., Git) and agile development methodologies.\n\nExcellent problem-solving skills and attention to detail.\n\nStrong communication and teamwork abilities.\n\nPreferred:\n\nExperience with other Python frameworks (e.g., Flask) and libraries.\n\nKnowledge of cloud platforms (e.g., AWS, Azure) and containerization technologies (e.g., Docker).\n\nFamiliarity with DevOps practices and CI/CD pipelines.\n\nUnderstanding of software testing principles and experience with testing frameworks.\n\nKnowledge of frontend build tools (e.g., Webpack) and package managers (e.g., npm, yarn).\n\nJoin our dynamic and collaborative team, and contribute to the development of innovative web applications using Django and Python. We offer competitive compensation and a supportive work environment that encourages continuous learning and professional growth.",
