            "job_description": "AWS Lead Candidate\n\nRemote\n\nManager Notes\n• UI Development with AWS.\n• They have a gap in their current team with React. So it is very important to have React experience.\n• Other key skills are TypeScript and Node.js\n• Domain Driven Development\n• Paired Programming\n• Training / coaching / mentoring and soft skills. This person will need to lead his/her pair.\n• Architecture will be more Event Streaming vs Batch\n\nDescription\n\nMust have AWS\n\nMust have pair programming\n• Why is this position open? How is it impacting the business? Increase in demand with adding additional depth to our existing product scope\n• Please describe the project work, and what do day-to-day responsibilities look like. This is shared with the candidate about the role so please share anything as it relates to the job so they have a good understanding of what they would be doing: A majority of the day to day work will reside in collaborating and pairing with team members to delivery software using AWS services to our customers. There will be daily and weekly ceremonies to attend as a team member. In the beginning there will be a lot of collaborating on the design and build out of the solution we are trying to build\n• What technologies or systems will this contingent worker be utilizing? AWS services, typescript, react, some java, nodejs, and CDK a. Potentially other similar cloud provider services but AWS and listed above is really preferred (so, just AWS! ~Caron)\n• Please provide background information on the application(s) this worker will be involved with:\n\nWe've built an existing UI and backend services to support this UI for our stakeholders. This application was built and will be enhanced using React, React test library, Nodejs, typescript, and some java\n• What skills are you looking for in the ideal candidate?\n• Strong communication skills\n• Informal leadership experience (documented in some way on the resume)\n• Pair programming / TDD\n• AWS Experience\n\nPreferred\n• CDK\n• Microservice architecture experience\n• Typescript/NodeJS Experience\n• UI technology experience (React/RTL/etc.)\n• Will this person be any sort of team lead? They are expected to have some informal leadership skills. Ability to teach team members inside and outside paired programming environments is very important\n• What is the size and culture of the team? Current team size is 7. Culture is strong with this team as they are very much self organizing. Some team members are in different phases of their skilling up journeys but everyone contributes in their own way whether it's through business knowledge or technical knowledge\n• Is this role onsite or remote? Remote is acceptable.\n• How long is this contract expected to last? Is there a possibility of extension beyond this date? 12 month contract but possibility of an extension\n• What does the interview process look like for this opening? 30 minute TEAMS interview",
