            "job_apply_is_direct": false,
            "job_apply_quality_score": 0.504,
            "job_description": "Syrinx Consulting\n\n100% Remote\n\n12-month contract with extensions\n\nSenior UI Engineer – React\n\nJOB SUMMARY\n\nWe are looking for an ambitious and talented React and Redux Developer to join our client’s team. You will leverage your knowledge to develop new consumer focused products. Your code, designs, and decisions will be highly visible, and will directly impact lots of users. We’re agile, intelligent, creative, flexible, but also very focused on an extraordinary and fun challenge. This is a great opportunity for a senior developer to make a big and meaningful impact on products important to the company.\n\nESSENTIAL DUTIES AND RESPONSIBILITIES\n\nAs a React Developer, you’ll be responsible for supporting and/or developing enterprise software, web applications and react components. You’ll work with written specifications and pre-established guidelines, and maintain process flow documentation. They are also responsible with gaining an understanding of business needs to develop level of effort estimates, software design & development, unit testing, performing design and code reviews, and development of technical documentation. Additional responsibilities include performing system analysis, code modifications, and functional testing to troubleshoot application production issues.\n\nHere are some specific duties (and you may be assigned others):\n• Writing reusable, testable, and efficient code that is clean well commented\n• Design and implementation of low-latency, high-availability, and performant applications\n• Implementation of security and data protection\n• Refactor existing code to be cleaner, more robust and reusable.\n• Supply plenty of inline code comments where necessary\n\nREQUIRED QUALIFICATIONS\n• Be able to work well with people of various backgrounds and education levels and establish cooperative working relationships with all coworkers.\n• Timely and effectively communicate information to and consult with others in order to complete work assignments.\n• Act in a responsible, trustworthy and ethical manner that considers the impact and consequences of one’s actions or decisions.\n• Communicate ideas, thoughts, and facts in writing through the use of proper grammar, spelling, document formatting and sentence structure.\n• Identify and respond to current and future clients’ needs; provide excellent client service.\n• Evaluate and analyze problems or tasks from multiple perspectives; adaptively employ problem solving methods to find creative or novel solutions; use logical, systematic and sequential processes to solve problems.\n• Complete assigned job tasks in an accurate and timely manner.\n• Carefully prepare for meetings and presentations; follow up with others to ensure that agreements, tasks or commitments have been fulfilled.\n• Demonstrate commitment to achieving Company’s core business objectives of increasing the role of pharmacy and improving patient health in America.\n\nSKILLS, EDUCATION, OR EXPERIENCE\n• Bachelors degree in Computer Science, Information Systems or related field\n• At least 3 years of real-world web and service development experience using React.js and Redux\n• Deep experience with web services API integration (Rest, JSON, XML)\n• Expert with front-end technologies, such as React and Redux, HTML5, and CSS3\n• Great attitude, team player and energy amplifier\n• Flexible and adaptable to changing priorities",
