            "employer_name": "Doran Jones",
            "employer_logo": "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS1N-9LyHgT6X_QPkS5aSwJIk0N5QcPjc0a6JgC&s=0",
