            "job_description": "We are searching for a Senior React Developer with an emphasis on security and performance.\n\nWe don't want you to write code regarding the following topics; this job is strictly a consulting position. You and our Lead Developer will go over our code in a joint call where you will use your expertise to offer your advice.\n\nYou should be able to consult us on the following topics:\n\n- Network\n\n- Session Management\n\n- Registration Feature\n\n- Login Feature\n\n- Error Codes\n\n- Post Login My Account\n\n- Forget Password\n\n- Cross-Site Scripting\n\n- Component and Prop: Consultation on testing React components and props to ensure they are functioning as expected.\n\n- State and Lifecycle: Evaluating how state and lifecycle methods are managed within our React components.\n\n- Redux Integration\n\n- Redux State Management with Reducer Calls\n\n- React Router Testing: If your app uses React Router for navigation, understanding how to test this would be beneficial.\n\n- Security of React Hooks\n\n- Server-side Rendering (SSR) security\n\n- Cross-Site Request Forgery (CSRF) prevention\n\n- Changes for Production?\n\n... any important topics we left out and you can recommend having a look\n\nAdd the term \"React Consulting Project\" to the beginning of your application as a sign of full reading.",
